from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones on key conflicts.
    None values are handled gracefully - None input dicts are skipped.

    Args:
        *dicts: Variable number of dictionaries to merge.

    Returns:
        A new dictionary with all keys merged.

    Raises:
        TypeError: If any argument is not a dictionary or None.

    Examples:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {'a': 1, 'b': 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {'a': 2}
        >>> merge_dicts({"a": 1}, None, {"b": 2})
        {'a': 1, 'b': 2}
    """
    result: Dict[str, Any] = {}

    for d in dicts:
        # Handle None gracefully by skipping
        if d is None:
            continue

        # Type check - ensure it's a dictionary
        if not isinstance(d, dict):
            raise TypeError(
                f"All arguments must be dictionaries or None, got {type(d).__name__}"
            )

        # Merge the dictionary
        result.update(d)

    return result


# Test cases
if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

    # Override behavior
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

    # None handling
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}
    assert merge_dicts(None, {"a": 1}) == {"a": 1}

    # Multiple merges with override
    assert merge_dicts(
        {"a": 1, "b": 2},
        {"b": 3, "c": 4},
        {"c": 5, "d": 6}
    ) == {"a": 1, "b": 3, "c": 5, "d": 6}

    # Empty dictionaries
    assert merge_dicts({}, {}) == {}
    assert merge_dicts({"a": 1}, {}) == {"a": 1}

    # Single dictionary
    assert merge_dicts({"a": 1}) == {"a": 1}

    # No arguments
    assert merge_dicts() == {}

    # None as values in dictionaries
    assert merge_dicts({"a": None}, {"b": 2}) == {"a": None, "b": 2}

    # Error handling - non-dict argument
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "dictionaries or None" in str(e)

